// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;

import "@openzeppelin/contracts/token/ERC1155/ERC1155.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/metatx/ERC2771Context.sol";
import "@openzeppelin/contracts/metatx/MinimalForwarder.sol";

contract Filmrare is ERC2771Context, ERC1155, Ownable, Pausable {
    /// @custom:oz-upgrades-unsafe-allow constructor

    using Counters for Counters.Counter;
    Counters.Counter private _tokenIds;

    mapping (uint256 => address) private _tokenCreators;
    mapping (uint256 => string) private _tokenCIDs;
    mapping (uint256 => uint256) private _tokenAmount;
    mapping (uint256 => address) private _tokenSeller;

    address _sellerAddress;

    constructor(MinimalForwarder forwarder)
        ERC2771Context(address(forwarder))
        ERC1155("https://ipfs.io/ipfs/{CID}/metadata.json") {
        _sellerAddress = _msgSender();
    }

    function _msgSender() internal view override(Context, ERC2771Context)
        returns (address sender) {
        sender = ERC2771Context._msgSender();
    }

    function _msgData() internal view override(Context, ERC2771Context)
        returns (bytes calldata) {
        return ERC2771Context._msgData();
    }

    function getCID(uint256 _tokenId) public view returns (string memory) {
        // require(_tokenCreators[_tokenId]!=0, "Token doesn't exist");
        return _tokenCIDs[_tokenId];
    }

    function getCreator(uint256 _tokenId) public view returns (address) {
        // require(_tokenCreators[_tokenId]!=0, "Token doesn't exist");
        return _tokenCreators[_tokenId];
    }

    function getQuantityLeft(uint256 _tokenId) public view returns (uint256) {
        require(_tokenAmount[_tokenId]!=0, "Token doesn't exist");
        return _tokenAmount[_tokenId];
    }

    function setURI(string memory newuri) public onlyOwner {
        _setURI(newuri);
    }

    function pause() public onlyOwner {
        _pause();
    }

    function unpause() public onlyOwner {
        _unpause();
    }

    function mint(
        address _to,
        uint256 _quantity,
        string calldata _CID
    ) public onlyOwner {
        _tokenIds.increment();

        uint256 newItemId = _tokenIds.current();
        _mint(_to, newItemId, _quantity, "");
        _tokenCreators[newItemId]= _to;
        _tokenCIDs[newItemId] = _CID;
    }

    function mintBatch(address to, uint256[] memory ids, uint256[] memory amounts, bytes memory data)
        public
        onlyOwner
    {
        _mintBatch(to, ids, amounts, data);
    }

    function _beforeTokenTransfer(address operator, address from, address to, uint256[] memory ids, uint256[] memory amounts, bytes memory data)
        internal
        whenNotPaused
        override
    {
        super._beforeTokenTransfer(operator, from, to, ids, amounts, data);
    }

    function purchaseToken(uint256 _tokenId, address _to) public returns (uint256) {
        require(_to != address(0) && _to != address(this), "Buyer is the owner");
        require(_tokenAmount[_tokenId]!=0, "Token doesn't exist");
        safeTransferFrom(_msgSender(), _to, _tokenId, 1, "");
        _tokenAmount[_tokenId] = _tokenAmount[_tokenId]-1;
        return _tokenAmount[_tokenId]-1;
    }

    function sellToken(uint256 _tokenId, address _to, uint256 _amount) public {
        address tokenSeller = _tokenCreators[_tokenId];
        require(balanceOf(tokenSeller, _tokenId)>=_amount, "Token sold out");
        safeTransferFrom(tokenSeller, _to, _tokenId, _amount, "");
        _tokenSeller[_tokenId] = _to;
        _tokenAmount[_tokenId] = _tokenAmount[_tokenId]+_amount;
    }

    function sendTo(address payable _payee, uint256 _amount) public {
        require(_payee != address(0) && _payee != address(this), "Cannot pay self");
        require(_amount > 0 && _amount <= address(this).balance, "Insufficient funds");
        _payee.transfer(_amount);
    }
}
